import { ReactNode } from 'react';
import {
  Box,
  Flex,
  Avatar,
  HStack,
  Link,
  IconButton,
  Button,
  Menu,
  Text,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  FormControl,
  FormHelperText,
  Input,
  Image,
  Heading,
  Container,
  Stack,
} from '@chakra-ui/react';


import { HamburgerIcon, CloseIcon, AddIcon } from '@chakra-ui/icons';

const Links = ['Home', 'Login', 'Sign Up'];

const NavLink = (props) => (
  <Link
    px={2}
    py={1}
    rounded={'md'}
    _hover={{
      textDecoration: 'none',
      bg: useColorModeValue('gray.200', 'gray.700'),
    }}
    href={props.path}>
    <Text
    color="blue.200"
    fontSize="sm"
    fontFamily="sans-serif" 
    fontWeight="bolder"
    >
    {props.element}
    </Text>
  </Link>
);

function NavigationBar() {
  const { isOpen, onOpen, onClose } = useDisclosure();

  return (
  
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
    <Container
      maxW={'7xl'}
      py={1}
      as={Box}
      spacing={12}
      bg='url(images/bg_0.png)'
      backgroundRepeat="no-repeat"
      backgroundSize="cover"
      sx={{ minWidth: '100vw', display: 'flex', justifyContent: 'center' }}
    >
          
      </Container>
  </div>
  );
}


export default NavigationBar;
